script: |
  super -f text -I q283.spq | sort > q283.out

inputs:
  - name: q283.spq
    data: |
      SELECT ALL + 37 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( - 42, - col1, + - 82 + - 7, + ( - col1 ), - col0 + col1 );
  - name: tab0

outputs:
  - name: q283.out
    data: |
